import React from "react"
import {
NavLink,
}
 from "react-router-dom";


function MyNetworkMentees () {
    return (
      <div>

         <div class="button"><NavLink to="/mymentees">MY MENTEES</NavLink></div>

        <h2>+</h2><p>Search mentee</p>
        {/* Here should appear a search field for mentees

        Here should appear a list of mentees user has in his own network		
 		*/}
 		<p>Alice</p><div class="button"><NavLink to="/chathistory">CHAT</NavLink></div>
  		<p>Alice</p><div class="button"><NavLink to="/chathistory">CHAT</NavLink></div>
 		<p>Alice</p><div class="button"><NavLink to="/chathistory">CHAT</NavLink></div>
 		<p>Alice</p><div class="button"><NavLink to="/chathistory">CHAT</NavLink></div>

        <div class="button"><NavLink to="/mymentors">MY MENTORS</NavLink></div>
        <div class="button"><NavLink to="/groups">MY GROUPS</NavLink></div>
      </div>
    )
  }


export default MyNetworkMentees
